import React from "react";
import img1 from "../img/img1.jpg";

function Header() {
  return (
    <section id="title">
      <div>
        {/* <!-- Nav Bar --> */}
        
        <img src={img1} alt=" " className="img1"></img>
        <div className="intro">
          <p className="Ptag col-lg-">
            "Empower. Unite. Transform lives. <br />
            Welcome to Sadaqa - A Beacon of Hope."
          </p>
        </div>
      </div>
    </section>
  );
}
export default Header;
